import Main from "./components/Main/Main";

function App() {
  return (
    <div>
      <HashRout>
        <Routes>
          <Route path="/" element={<Login/>} />
          <Route path="/signUp" element={<SignUp/>} />
          <Route path="/mainSpace" element={<MainSpace/>} />
      </Routes>
      </HashRout>
    </div>
  );
}

export default App;
